import { FaGithub } from 'react-icons/fa';


const MyComponent = () => {
    return (
      <div>
        <a href="https://github.com/us579">
          <FaGithub size={16} />
        </a>
      </div>
    );
  };

const About = () => {
    return (
        <div>
            <h1>Hi, I'm Steven</h1>
            <h5>A developer who interested in anything web dev.</h5>
            <MyComponent />
            <Dog />

        </div>

    )
}

export default About;
